※複数ご注文の場合、１配送先につき送料１個分のみかかります。<br><img src='http://image.rakuten.co.jp/eco-life-r/cabinet/icon/abouthaiso1.jpg' style='margin-bottom:10px;'><br><img src='http://image.rakuten.co.jp/eco-life-r/cabinet/icon/haiso6.jpg' style='margin-bottom:10px;'><br><br><font color='red'>※北海道は送料1500円です。その他エリアは900円です。 <br><br>
※飾り蛇口およびアタッチメント製品(ホースアダプター、ホースカプラー、泡沫アダプター)は凍結破損する恐れがあります。</font><br>
寒冷地ばかりではなく凍結の恐れのある地域では、蛇口から少量の水を出し続ける、配管内の水を抜く、ヒーター等で保温するなど、
設置をする地域や気象状況に応じた凍結防止対策を行ってください。<br>
凍結による破損で交換する場合、有償となりますので予めご了承ください。<br><br><style type="text/css">
